import React from 'react';
import Chart from 'react-google-charts';

const Test = () => {
  const dataPoints = [['x', 'Total'], [0, 0]];
  let runningTotal = 0;
  for (let i = 1; i <= 20; i++) {
    runningTotal += i;
    dataPoints.push(
      [i, runningTotal]
    );
  }

  return (
  <div className='border'>
    <Chart
      chartType="LineChart"
      loader={<div>Loading Chart</div>}
      data={dataPoints}
      options={{
        legend: {
          position: none
        },
        hAxis: {
          title: 'Days',
          baselineColor: 'red',
          gridlines: {
            color: 'black'
          },
          minValue: 30,
          minorGridlines: {
            count: 0
          },
          textStyle: {
            fontName: 'sans-serif',
            fontSize: 0,
            italic: false
          },
          slantedTextAngle: 0
        },
        vAxis: {
          title: 'Miles',
        },
      }}
      rootProps={{ 'data-testid': '1' }}
    />
  </div>
  );
}

export default Test;
